import React, { useState } from "react";

function App() {
  const [query, setQuery] = useState("");
  const [result, setResult] = useState(null);

  const handleSearch = async (e) => {
    e.preventDefault();
    // Dummy fetch
    setResult({ result: `Dummy result for ${query}`, source: "backend" });
  };

  return (
    <div className="flex min-h-screen bg-gray-100">
      {/* Sidebar */}
      <aside className="w-64 bg-white p-4 shadow">
        <h2 className="font-bold text-lg mb-4">CacheCraft Dashboard</h2>
        <div className="text-sm text-gray-600">(Dashboard stats here)</div>
      </aside>
      {/* Main */}
      <main className="flex-1 p-8">
        <form onSubmit={handleSearch} className="mb-6">
          <input
            className="border p-2 rounded w-80"
            placeholder="Search..."
            value={query}
            onChange={e => setQuery(e.target.value)}
          />
          <button className="ml-2 px-4 py-2 bg-blue-600 text-white rounded" type="submit">Search</button>
        </form>
        {result && (
          <div className="bg-white p-4 rounded shadow">
            <div className="font-bold">{result.result}</div>
            <div className="text-xs mt-2">Source: {result.source}</div>
          </div>
        )}
      </main>
    </div>
  );
}

export default App;
